import React from 'react';
import Image from './Image';
// import NoGifs from './NoGifs'

const Gallery = props => { 

  const results=props.data
  let images

  if (results.length>0){
    images=results.map(image=><Image url={`https://farm${image.farm}.staticflickr.com/${image.server}/${image.id}_${image.secret}.jpg`} alt={`${image.title}`} key={image.id}/> )
  }else{
    // gifs=<NoGifs />
  }


  return(
    <ul >
      {images}
    </ul> 
  );
}

export default Gallery;
